query:
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Vermont - Burlington Chittenden', 'Vermont', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Virginia - Northern Virginia Fairfax Arlington Alexandria', 'Virginia', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Washington - Seattle King Pierce Snohomish', 'Washington', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Washington - Spokane', 'Washington', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('West Virginia - Charleston Kanawha', 'West Virginia', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Wisconsin - Madison Dane', 'Wisconsin', '2025', NOW());
INSERT IGNORE INTO counties (name, state, protocolVersion, createdAt) VALUES ('Wyoming - Cheyenne Laramie', 'Wyoming', '2025', NOW());

-- Check total agencies and states now
SELECT 
  (SELECT COUNT(*) FROM counties) as total_agencies,
  (SELECT COUNT(DISTINCT state) FROM counties) as total_states;

